DROP TABLE IF EXISTS `moves`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `moves` (
  `game_id` int(11) NOT NULL,
  `move_number` int(11) DEFAULT NULL,
  `user_id` int(11) NOT NULL,
  `figure_id` int(11) DEFAULT NULL,
  `field` int(11) DEFAULT NULL,
  KEY `moves_user_id_fk` (`user_id`),
  KEY `moves_figure_id_fk` (`figure_id`),
  KEY `moves_game_id_fk` (`game_id`),
  KEY `moves_game_id_user_id_move_number_idx` (`game_id`,`user_id`,`move_number`),
  CONSTRAINT `moves_figure_id_fk` FOREIGN KEY (`figure_id`) REFERENCES `figures` (`id`),
  CONSTRAINT `moves_game_id_fk` FOREIGN KEY (`game_id`) REFERENCES `games` (`id`),
  CONSTRAINT `moves_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

