/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `set_tournament_winner` AFTER UPDATE ON `tournaments` FOR EACH ROW BEGIN	
IF (NEW.status_id = 3) THEN 
INSERT INTO  tournaments_winners(winner_id,tournament_id)
SELECT u.id, t.id
FROM users u
JOIN games g
ON u.id = g.black or u.id = g.white
JOIN tournaments t
ON g.tournament_id = t.id
JOIN profile p 
ON u.id=p.user_id
WHERE t.id = NEW.id
ORDER BY scores_sum(u.id, t.id) DESC, user_rating DESC LIMIT 1;
END IF;
END */;;
DELIMITER ;
